Defendant Jay H Effenberger in court with attorney Jamie F Cimpl-Wiemer.  Defendant Jay H Effenberger in custody.  Jesica A Ballenger appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

The defendant was advised of his constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.   The Court amends criminal complaint and information to reflect the true d.o.b. of 12-19-69 for the defendant.  

Sentencing proceeded.   Statements made by State, defense, and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 8 YEARS, CONCURRENT to Washington County case 05CF122, CONSECUTIVE to any other sentence with credit for 0 days served at this time (to be submitted by defense).  The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 4 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 4 YEARS.

The defendant IS NOT eligible for the Challenge Incarceration Program.  The defendant IS eligible for the Substance Abuse Program AFTER SERVING TWO YEARS OF THIS SENTENCE.

CONDITIONS OF EXTENDED SUPERVISION:
*Obtain mental assessment and successfully complete follow-up treatment- take any medication in the dosage as prescribed by treating physician only;
*Obtain AODA assessment and successfully complete follow-up treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No drug dealing or association with drug community (drug users/dealers or drug houses);
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Obtain/maintain full time employment or full time school and part time employment;
*No employment at alcohol related industry jobs (liquor store, bars etc..)
*No contact with bar establishments;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;

The Court ordered defendant to pay a fine of $1200.000 plus all mandatory costs, penalties, surcharges, including $50.00 ignition interlock surcharge. Court ordered AODA assessment and Driver's Safety Plan.  Court ordered defendant's driving privileges revoked for a period of 36 months.  Court ordered defendant restricted to operation of vehicles equipped with an ignition interlock device for 36 months.  The Court ordered that all financial obligations be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Appeal rights given by the court.  
